  <tr>
    <th>商品の説明</th>
  </tr>
  <tr>
    <td>部屋干し用の消臭スプレー。なま乾きの嫌なニオイもニオイの元から分解・消臭し、さらに効果が持続します。脱水をした洗濯物にスプレーした瞬間から消臭効果を発揮し、なま乾きの嫌なニオイを解消。袖を通してからも消臭効果が持続します。<br>
<span class="txtstyle01">【使用方法】</span><br>
・ノズル先端に付いているストッパーを下へ引き抜き、液が出るまで数回ハンドルを握ってスプレーしてください。<br>
・脱水をしたお洗濯物を室内物干に干した後、20cm以上はなしてスプレーして下さい。<br>
・スプレーする回数は洗濯物1枚に2～3回が目安です。
</td></tr>
